import styled from 'styled-components';

export const Container = styled.div`
  border: 2px solid #232129;
  border-radius: 10px;
  input {
    flex: 1;
    background: transparent;

    padding: 16px;
    width: 100%;
    display: flex;
    align-items: center;
    margin-top: 8px;
    color: #001d50;
    &::placeholder {
      color: #001d50;
    }
  }
`;
